import LinearProgress from '@mui/material/LinearProgress';
import React, {useEffect} from "react";
import {useDispatch, useSelector} from "react-redux"
import { addExperience } from "../../../store/expReducer";
function Prof() {
    const exp = useSelector((state) => state.skills.skills[0].exp)
    const dispatch = useDispatch()

    console.log(exp)

    const addExp = () => {
        dispatch(addExperience({ exp: 5, skillId: "1" }));
    };
    useEffect(() => {
        const interval = setInterval(() => {
            addExp();
        }, 5000);

        return () => {
            clearInterval(interval); // Cleanup the interval on component unmount
        };
    }, []);
    const reqExp = 1200
    return (

        <div id="prof">
            

            <div className="wood-cutting-buttons">
                <div className={"prof-block pointer "} onClick={() => addExp()}></div>
                <div className={"prof-block pointer "} onClick={() => addExp()}></div>



            </div>


        </div>

    );
}

export default Prof;
